let auth_token = "";

let projectSkipForm = document.querySelector(".info-form");

console.log("hi");

if (projectSkipForm) {
  console.log("hi2");
  const onSubmit = (formData) => {
    console.log(formData.entries());
    let auth_token = formData.get("authcode");
    let project = formData.get("project");

    if (auth_token && project) allProjects[project.toString()](auth_token.toString());
  };
  projectSkipForm.onsubmit = (ev) => {
    (async () => {
      let testData = null;
      chrome.tabs.query({ active: true, currentWindow: true }, (tabs) => {
        tabs.forEach((tab) => {
          console.log(tab);
          testData = chrome.tabs
            .sendMessage(tab.id, {
              type: "LOCALSTORAGE_DATA",
            })
            .then((testData) => {
              console.log(testData);
              testData = testData.data;

              if (testData != null) {
                console.log("hi3");
                console.log(testData);
                const formData = new FormData(projectSkipForm, ev.submitter);
                formData.set("authcode", testData);
                onSubmit(formData);
              }
            });
        });
      });
    })();
    ev.preventDefault();
  };
}
